import React from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import PlanetScreen from './screens/planets'

const Routers = () => (
    <BrowserRouter>
    <Layout>
    <Routes>
        <Route exact path='/' element={<PlanetScreen/>}/>
    </Routes>
    </Layout>
    </BrowserRouter>
)
export default Routers;
